 `TemplateEngine` and set the dialect

I tried that and the onInitialized event never fires. Sorry I just started working on Micronaut, so maybe you have an idea what I'm doing wrong?

```kotlin
@Singleton
class ThymeleafDialectLoader : BeanInitializedEventListener<TemplateEngine> {
    override fun onInitialized(event: BeanInitializingEvent<TemplateEngine>): TemplateEngine =
        event.bean.apply {
            addDialect(LayoutDialect())
        }
}
```


An "eager loading" approach however works:

```kotlin
@Singleton
@Context
class ThymeleafDialectLoader(val templateEngine: TemplateEngine) {

    @PostConstruct
    fun setDialect() {
        templateEngine.addDialect(LayoutDialect())
    }
}
```', 'reactions': {'url': 'https://api.github.com/repos/micronaut-projects/micronaut-core/issues/comments/1057455962/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'performed_via_github_app': None}}

